package com.aistudio.kaidzentracker.android.data.localDataSource.flowDataSourceimport androidx.annotation.NonNullimport androidx.room.Entityimport androidx.room.PrimaryKey@Entity(tableName = "flowEntity")data class FlowEntity(    @NonNull    @PrimaryKey(autoGenerate = true)    val id: Long = 0L,    val firstQuestions: Double?,    val secondQuestions: Double?,    val threeQuestions: Double?,    val fourQuestions: Double?,    val fiveQuestions: Double?,    val sixQuestions: Double?,    val result: Double? = null,    val newResult: Double? = null,)